webpackJsonp([0xd9dbaa42951e],{7275:function(t,e){t.exports={data:{post:{html:'<p><a title="Hack the Planet: Sunday, March 27, 2005" href="http://wmf.editthispage.com/2005/03/27">Hack the Planet</a> on Autopackage: </p>\n<blockquote><p>I\'m not sold on the <a href="http://www.autopackage.org/">Autopackage</a> system, but I agree with their analysis of the problems with <a href="http://bylands.dur.ac.uk/%7Emh/autopackage.org/faq.html#2_1">kitchen-sink Linux distributions</a> and <a href="http://bylands.dur.ac.uk/%7Emh/autopackage.org/faq.html#4_1">extreme software modularity</a>.<br />\nOne issue that is not mentioned is that Autopackage encourages<br />\ninstallation of untested configurations; this is not too surprising<br />\ngiven that everybody else does, too, and the open source world has<br />\nlargely abandoned testing anyway.</p></blockquote>',fields:{title:"Lack of Testing",date:"28 Mar 2005",url:"https://papascott.de/2005-03-28-lack-of-testing/"}}},pathContext:{slug:"/2005-03-28-lack-of-testing/",prev:{fields:{title:"greenpeace.spiegel.de",date:"28 Mar 2005",slug:"/2005-03-28-greenpeacespiegelde/"}},next:{fields:{title:"The Totals On The Board Are Correct",date:"28 Mar 2005",slug:"/2005-03-28-the-totals-on-the-board-are-correct/"}}}}}});
